  config: ISafeLocalStorageConfig<T>
): SafeLocalStorage<T> | MemoryStorage<T> => {
  if (!isLocalStorageSupported()) {
    return new MemoryStorage(config);
  }

  return new SafeLocalStorage(config);
};

